import React,{useEffect} from 'react'
import '../src/index.css'
import GSAP from 'gsap'
function Main(){
    let eff=useEffect();
    useEffect(()=>{GSAP.to(eff,{opacity:1,x:40,duration:2})});
    return(
        <div className='Frame'>
            <h1 className='message' ref={el=>eff=el}>Hi</h1>
            <div class='work'>
                <button className='button'>Connect Metamask</button>
            </div>
            <p>Enter your message</p>
        </div>
    )
}
export default Main;
